									 elseif type(k) == "nil" then
										 out = out..("    ["..tostring(l).."] null")..("\n"):format()
									 elseif type(k) == "number" then
										 out = out..("    ["..tostring(l).."] Value -> "..tostring(k)..", Type -> "..type(k))..("\n"):format()
