						 s.x = math.sin(x)
						 s.y = math.sin(y)
						 x, y = x + 0.1, y + 0.1
						 
						 local cframe =
							 center *
							 CFrame.new() *
							 CFrame.Angles(r(s.y*10), circ + r(s.y*8), r(s.x*10))
