						 s.x = math.sin(x)
						 s.y = math.sin(y)
						 x, y = x + 0.1, y + 0.1
						 
						 local cframe =
							 center *
							 CFrame.new(0, 0, 0) *
							 CFrame.Angles(0, 0, circ + 0)
						 local offset =
